import React, { useState, useEffect } from 'react';
import './Profile.css';
import ActivityChart from '../charts/ActivityChart/ActivityChart';
import AverageSessionsChart from '../charts/AverageSessionsChart/AverageSessionsChart';
import NutritionalInfo from '../charts/NutritionalInfo/NutritionalInfo';
import RadarChart from '../charts/PerformanceChart/RadarChart';
import ScoreChart from '../charts/ScoreChart/ScoreChart';

// –î–µ—Ñ–∏–Ω–∏—Ä–∞–º–µ –ø—Ä–∞–∑–µ–Ω –æ–±—ò–µ–∫—Ç –∑–∞ –º–æ–∫–∏—Ä–∞–Ω–∏—Ç–µ –ø–æ–¥–∞—Ç–æ—Ü–∏, —à—Ç–æ —Å–µ –∫–æ—Ä–∏—Å—Ç–∏ –∫–æ–≥–∞ API –Ω–µ –µ –¥–æ—Å—Ç–∞–ø–µ–Ω
const emptyUserData = {
  userInfos: {
    firstName: 'John', // –î–æ–¥–∞–¥–µ—Ç–µ –∏–º–µ –ø–æ –∏–∑–±–æ—Ä
  },
  keyData: {
    calorieCount: 0,
    proteinCount: 0,
    carbohydrateCount: 0,
    lipidCount: 0,
  },
  score: 0,
};

const Profile = ({ userId }) => {
  const [userData, setUserData] = useState(null);
  const [userActivity, setUserActivity] = useState(null);
  const [userAverageSessions, setUserAverageSessions] = useState(null);
  const [userPerformance, setUserPerformance] = useState(null);

  // –°–∏–º—É–ª–∏—Ä–∞—ö–µ –Ω–∞ –∑–µ–º–∞—ö–µ –Ω–∞ –ø–æ–¥–∞—Ç–æ—Ü–∏ –æ–¥ API
  useEffect(() => {
    // –í–∞—à–∏–æ—Ç API endpoint –∑–∞ –∑–µ–º–∞—ö–µ –Ω–∞ –ø–æ–¥–∞—Ç–æ—Ü–∏
    const fetchUserData = async () => {
      try {
        // –°–∏–º—É–ª–∏—Ä–∞—ö–µ –Ω–∞ –≤—Ä–µ–º–µ –∑–∞ –≤—á–∏—Ç—É–≤–∞—ö–µ
        await new Promise(resolve => setTimeout(resolve, 1000));
        // –ê–ø–∏—Ä–∞—ò—Ç–µ –Ω–∞ —Å–µ—Ä–≤–µ—Ä –∑–∞ –∫–æ—Ä–∏—Å–Ω–∏–∫–æ—Ç —Å–æ –¥–∞–¥–µ–Ω–æ—Ç–æ userId
        // –ù–∞ –ø—Ä–∏–º–µ—Ä, –º–æ–∂–µ –¥–∞ –∫–æ—Ä–∏—Å—Ç–∏—Ç–µ fetch –∏–ª–∏ axios
        // const response = await fetch(`/api/user/${userId}`);
        // const data = await response.json();

        // –ü—Ä–∏–º–µ—Ä –Ω–∞ –∫–∞–∫–æ –±–∏ –∏–∑–≥–ª–µ–¥–∞–ª–æ –ø–æ–≤–∏–∫–æ—Ç –¥–æ —Ä–µ–∞–ª–µ–Ω API
        // –ó–∞ —Å–µ–≥–∞, –∫–æ—Ä–∏—Å—Ç–∏–º–µ –º–æ–∫–∏—Ä–∞–Ω–∏ –ø–æ–¥–∞—Ç–æ—Ü–∏ (emptyUserData) –∫–æ–≥–∞ –Ω–µ–º–∞–º–µ —Ä–µ–∞–ª–µ–Ω API
        const mockUserData = {
          ...emptyUserData,
          userInfos: {
            ...emptyUserData.userInfos,
            firstName: 'Jane', // –ü—Ä–∏–º–µ—Ä –Ω–∞ –º–æ–∫–∏—Ä–∞–Ω–æ –∏–º–µ
          },
          keyData: {
            calorieCount: 1800,
            proteinCount: 120,
            carbohydrateCount: 250,
            lipidCount: 70,
          },
          score: 85,
        };

        setUserData(mockUserData);
        setUserActivity(mockData.USER_ACTIVITY.find(activity => activity.userId === parseInt(userId)));
        setUserAverageSessions(mockData.USER_AVERAGE_SESSIONS.find(session => session.userId === parseInt(userId)));
        setUserPerformance(mockData.USER_PERFORMANCE.find(performance => performance.userId === parseInt(userId)));
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };

    fetchUserData();
  }, [userId]);

  if (!userData || !userActivity || !userAverageSessions || !userPerformance) {
    return <div>Loading...</div>;
  }

  return (
    <div className="profile-container">
      <div className='profile-header-section'>
        <div className="profile-header">
          <h1>Bonjour <span className="user-name">{userData.userInfos.firstName}</span></h1>
          <p>F√©licitation ! Vous avez explos√© vos objectifs hier üëè</p>
        </div>
        <div className="section-activity">
          <ActivityChart data={userActivity.sessions} />
        </div>
        <div className='trois-sections'>
          <div className="section">
            <AverageSessionsChart data={userAverageSessions.sessions} />
          </div>
          <div className="section">
            <RadarChart data={userPerformance.data} />
          </div>
          <div className="section">
            <ScoreChart data={{ score: userData.score }} />
          </div>
        </div>
      </div>
      <div className="sections">
        <NutritionalInfo
          calorieCount={userData.keyData.calorieCount}
          proteinCount={userData.keyData.proteinCount}
          carbohydrateCount={userData.keyData.carbohydrateCount}
          lipidCount={userData.keyData.lipidCount}
        />
      </div>
    </div>
  );
};

export default Profile;
